$_MODULE['<{ets_cfultimate}prestashop>help_55deac9cea67b28b657a3414d491a1e5'] = 'Formularios de contacto';
$_MODULE['<{ets_cfultimate}prestashop>help_e78f8e3951507d3ad70bad04d263a0f6'] = 'Al crear un nuevo formulario de contacto, si hace clic en [1]\"Agregar nuevo campo / fila de entrada para crear su formulario de contacto\"[/1] y selecciona un campo de entrada, este campo de entrada se colocará en forma predeterminada fila de ancho completo (1 columna)';
$_MODULE['<{ets_cfultimate}prestashop>help_44bc6f8a71dc89fff236e12f6f869244'] = 'Para agregar el campo de entrada reCAPTCHA, primero debe habilitar reCAPTCHA. Vaya a [1]\"Ajustes > Integración > reCAPTCHA\"[/1], habilite la opción reCAPTCHA e ingrese su par de claves.';
$_MODULE['<{ets_cfultimate}prestashop>help_fde06cf9e07c495e4089187d22fe1f8b'] = 'Para saber cómo obtener la reCAPTCHA clave del sitio y la clave secreta, lea la documentación de nuestro módu';
$_MODULE['<{ets_cfultimate}prestashop>help_f9654c9df3f610569dd727b769581e6f'] = 'Para poder responder los mensajes de los clientes directamente en el back office, necesita la dirección de correo electrónico de su cliente. Al crear un formulario de contacto, asegúrese de agregar un campo de entrada de correo electrónico y marcarlo como el campo requerido.';
$_MODULE['<{ets_cfultimate}prestashop>help_df8334930ebd39a1c1bd49057ddb3586'] = 'Configuraciones de correo electrónico';
$_MODULE['<{ets_cfultimate}prestashop>help_439cf3a9e0342a20b68fcded2619e240'] = 'Para obtener la información de su formulario de contacto al correo electrónico enviado al administrador o al respuesta automática, copie y pegue las etiquetas de correo respectivas en [1]\"Cuerpo del mensaje\"[/1] en [1]\"Formularios de contacto > Correo\" [/1] subficha';
$_MODULE['<{ets_cfultimate}prestashop>help_853b64314f465e7a1ebc1c63287ac7f1'] = 'Para recibir el archivo adjunto de su cliente por correo electrónico, vaya a [1]\"Formularios de contacto > Correo\"[/1] y marque la casilla [1]\"Archivo adjunto\"[/1].';
$_MODULE['<{ets_cfultimate}prestashop>help_7f83c7fcf109140ce437c3822fa1ce7a'] = 'Para recibir el archivo adjunto de su cliente a través de la pestaña \"Mensajes\", navegue a [1]\"Formularios de contacto > Ajustes\"[/1] y active la opción [1]\"Guardar adjuntos\"[/1].';
